import React from 'react'

function CategorieList({categories}) {
    return (
        <>
            <select value="">
                <option value=''>----</option>
                {
                    categories.map((cat) => {
                        return (
                            <option key={cat} value={cat}>{cat}</option>
                        )
                    })
                }
            </select>
        </>
    )
}

export default CategorieList;
